import React, { useState, useEffect } from 'react';




const Card = ({ apiKey }) => {
    const [users, setUser] = useState([]);

    const getUser = async () => {
        const response = await fetch('https://api.data.gov.in/resource/93b75aee-8eed-4fd5-913f-8284ffe733e8?api-key=579b464db66ec23bdd000001d8a81c4d7ec9481349495e230cdaab42&format=json')
        setUser(await response.json());

    }
    useEffect(() => {
        getUser();
    }, [apiKey]);

    return (

        <div class="card">

            <div class="card-body">
                <h4 class="card-title">{users.title}</h4>
                <h4 class="card-text">{users.index_name}</h4>
                <h4 class="card-text">{users.desc}</h4>
                <h4 class="card-text">{users.org_type}</h4>
                <h4 class="card-text">{users.org}</h4>
                <h4 class="card-text">{users.sector}</h4>
                <h4 class="card-text">{users.source}</h4>
                <h4 class="card-text">{users.target_bucket}</h4>
                {/* <h4 class="card-text">{users.field}</h4> */}
                {/* <h4 class="card-text">{users.source}</h4>
                <h4 class="card-text">{users.source}</h4>
                <h4 class="card-text">{users.source}</h4>
                <h4 class="card-text">{users.source}</h4>
                <h4 class="card-text">{users.source}</h4> */}



            </div>
        </div>






    );
}

export default Card;
